import { useParams } from 'react-router-dom';
import data from '../../helpers/data';

const RoutineDays = () => {
    const { id } = useParams();
    const routine = data.find(routine => routine.id === id);

    return (
        <>
            {routine?.routines?.[0].name}
        </>
    )

};

export default RoutineDays;
